/**
 * echart图表导出流程 1.获得echart初始化生成的Chart对象 2.将Chart对象作为参数，
 * 传入ChartPlugin.echartExport(chart,index)方法，
 * 解析生成base64字符串保存在ChartPlugin.charts数组中 3.调用ChartPlugin.exportToWord(datas,
 * websites, threads, charts)方法，将所有模板数据，传入后台，调用相应组件生成word报告
 */
var ChartPlugin = {
	
	//为传入的jquery对象覆盖半透明灰色的div
	fullScreenWhenLoading: function (ele, addOrRemove){//1的时候添加，2的时候去掉
		var full_idv_name = "div_full_ele";
		if(addOrRemove==1){
			var heightVal = ele.height();
			var div_full = $("<div name='"+full_idv_name+"' style='filter:alpha(opacity=40);opacity:0.4;position:absolute;top:0px;left:0px;width:100%;height:"+heightVal+"px;background-color:#000000;z-index:1000;'></div>");
			ele.append(div_full);
		} else if (addOrRemove==2){
			ele.find("[name='"+full_idv_name+"']").remove();
		}
	},
		
		
	
	reportExport: function(datas, charts) {
		var param = {};
		if (datas) {
			param["infoFilterVo.realName"] = datas.netizen_name;
			param["infoFilterVo.nickName"] = datas.netizen_sex;
			param["infoFilterVo.category"] = datas.netizen_category;
			param["infoFilterVo.stime"] = datas.netizen_posttotal;
			param["infoFilterVo.site_name"] = datas.netizen_sitename;
			param["infoFilterVo.job"] = datas.netizen_note;
		}

		if (charts) {
			for (i in charts) {
				if (!charts[i]) {
					charts[i] = "data:image/png;base64,";
				}
			}
			param["doc.imgList[0]"] = charts.image1;
			param["doc.imgList[1]"] = charts.image2;
		}


		$.ajax({
			type: "post",
			dataType: "json",
			url: "json_infoQuery_report_to_word_or_pdf.action",
			data: param,
			success: function(json) {
				if (json.msg) {
					if (json.msg == "error") {
						alert("系统繁忙!");
					} else {
						if(window.confirm("报告制作完成，是否下载？")){
							window.location.href = "load_infoQuery_download_report.action?data=" + $.trim($("font[name=netizen_name]").html()) + "@_@" + json.msg;
						}
					}
				} else {
					alert("系统繁忙!");
				}
				ChartPlugin.fullScreenWhenLoading($("body"), 2);
			},
			error: function() {
				alert("系统繁忙!");
				ChartPlugin.fullScreenWhenLoading($("body"), 2);
			}
		});

	},
	// chart ： echart的Chart对象，index ： 表示 该图表在模板中的位置
	echartExport: function(chart, index) {
		if (chart) {
			var dataURL = chart.getDataURL();
			ChartPlugin.charts["image" + index] = dataURL;
		}
	},
	highChartExport: function(chart, index, canvasId) {
		if (chart) {
			var svg = chart.getSVG();
			canvg(canvasId, $.trim(svg));

			var imgSrc = document.getElementById(canvasId).toDataURL("image/png");

			ChartPlugin.charts["image" + index] = imgSrc;
		}
	},
	d3Export: function(container, index, canvasId) {
		if (container) {
			var svg = $(container).prop("outerHTML");

			canvg(canvasId, $.trim(svg));

			var imgSrc = document.getElementById(canvasId).toDataURL("image/png");

			ChartPlugin.charts["image" + index] = imgSrc;
		}
	},
	svgToBase64: function(container, index, canvasId) {
		if (container) {

			var svg = $(container).prop("outerHTML");
			canvg(canvasId, $.trim(svg));

			var imgSrc = document.getElementById(canvasId).toDataURL("image/png");

			ChartPlugin.charts["image" + index] = imgSrc;
		}
	},
	canvasToBase64: function(canvas, index) {
		if (canvas) {

			var imgSrc = document.getElementById(canvas).toDataURL("image/png");

			ChartPlugin.charts["image" + index] = imgSrc;
		}
	},
	datas: {
		"netizen_name": "",
		"netizen_sex": "",
		"netizen_category": "",
		"netizen_posttotal": "",
		"netizen_sitename": "",
		"netizen_note": ""
	},
	charts: {
		"image1": "",
		"image2": ""
	},
	chartList: {
		"1": "",
		"2": ""
	},
	saveChart: function(chart, index) {
		ChartPlugin.chartList[index] = chart;
	},
	imgToBase64: function(img, index) {
		if (img) {
			var imgSrc = $(img).attr("src");
			ChartPlugin.charts["image" + index] = imgSrc;
		}
	},
	checkImgUpload: function(fileId, resultId) {
		var result = document.getElementById(resultId);
		if (typeof FileReader == 'undefined') {
			result.innerHTML = '<p>抱歉，您的浏览器不支持FileReader</p>';
			var file = document.getElementById(fileId);
			file.setAttribute('disabled', 'disabled');
		}
	},
	imgUpload: function(fileId, resultId) {
		var file = document.getElementById(fileId).files[0];
		var result = document.getElementById(resultId);
		//console.log(file.type);
		var reg = new RegExp("image/png");

		var reg = new RegExp("image/png|image/jpeg|image/gif|image/bmp");
		if (!reg.test(file.type)) {
			alert("只能上传图片！");
			return;
		}
		//console.log(file.size);
		/*
		if (file.size > 50 * 1024) {
			alert("图片大小超过50KB，无法上传");
			return;
		}
		*/
		var reader = new FileReader();

		/*
		 * reader.onprogress = function(e) { //alert('progress'); var total =
		 * e.total; var loaded = e.loaded; var progress =
		 * document.getElementById('progress'); progress.value = (loaded /
		 * total) * progress.max; } reader.onloadend = function(e) { if (e.total !=
		 * 0) { var progress = document.getElementById('progress');
		 * progress.value = progress.max; } }
		 */

		reader.onload = function(e) {
			result.innerHTML = "<img  src='" + this.result + "' />";
		}

		reader.readAsDataURL(file);

	},
	checkImgIsExsit: function(contianer) {
		if (contianer) {
			return $(contianer).find("img").length > 0;
		}
	}
	//report : {}
}

